*
 * 有网络且不是Wifi, 需要提醒用户不是wifi环境了
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @param {number} params.needNotify 无网或
 *
 * @returns {Promise<*>}：params.needNotify （无网或wifi：0；有网且非wifi：1）
 *
 * @example
 * libSQ.exec('is-need-notify-no-wifi', {
 * }).then((info) => {
 *    alert(`[is-need-notify-no-wifi][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *    alert(`[is-need-notify-no-wifi][error] ${JSON.stringify(err, null, 2)}`);
 * });

